import SkillBar from 'react-skillbars';
const Graph = () => {
    const skills = [
        {
            type: 'Java',
            level: 100,
            color: {
                bar: '#3498db',
                title: { text: '#fff', background: '#2980b9' }
            }
        },
        {
            type: 'React',
            level: 85,
            color: {
                bar: '#4288d0',
                title: { text: '#fff', background: '#124e8c' }
            }
        },
        {
            type: 'Javascript',
            level: 75, color: {
                bar: '#2c3e50',
                title: { text: '#fff', background: '#2c3e50' }
            }
        },
        {
            type: 'Spring',
            level: 50, color: {
                bar: '#5a68a5',
                title: { text: '#fff', background: '#46465e' }
            }
        },
        {
            type: 'Docker',
            level: 25,
            color: {
                bar: '#525252',
                title: { text: '#fff', background: '#333333' }
            }
        },
        {
            type: 'HTML',
            level: 20,
            color: {
                bar: 'black',
                title: { text: '#111', background: '#fff' }
            }
        },
        {
            type: 'NoSQL',
            level: 0,
            color: {
                bar: '#2ecc71',
                title: { text: '#fff', background: '#27ae60' }
            }
        }
    ];
    
}
<SkillBar skills={skills} />
export default Graph
